import React from "react";
import "../App.css";
import "../css/About.css";
import { makeStyles, createStyles, Theme } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faPeopleCarry,
  faRunning,
  // faUser,
  faChild
} from "@fortawesome/free-solid-svg-icons";
import { faBlogger, faGithub } from "@fortawesome/free-brands-svg-icons";

const aboutStyles = makeStyles((theme: Theme) =>
  createStyles({
    root: {
      flexGrow: 1
    },
    keyword: {
      padding: theme.spacing(3),
      textAlign: "center",
      color: theme.palette.text.secondary
    },
    profile: {
      padding: theme.spacing(10),
      textAlign: "center",
      color: theme.palette.text.secondary
    },
    education_career: {
      padding: theme.spacing(5),
      textAlign: "center",
      color: theme.palette.text.secondary
    }
  })
);

function About() {
  const aboutStyle = aboutStyles();

  return (
    <div id="about" className="background-color-gray menu-top-padding">
      <div>
        <p className="menu-name">ABOUT</p>
      </div>
      <Grid container spacing={1}>
        <Grid item xs={12} sm={4} md={5}>
          <FontAwesomeIcon icon={faChild} className="icon-size" />
          <p className="text-bold text-1H text-color-bl">Positive</p>
        </Grid>
        <Grid item xs={12} sm={4} md={2}>
          <FontAwesomeIcon icon={faRunning} className="icon-size" />
          <p className="text-bold text-1H text-color-bl">patience</p>
        </Grid>
        <Grid item xs={12} sm={4} md={5}>
          <FontAwesomeIcon icon={faPeopleCarry} className="icon-size" />
          <p className="text-bold text-1H text-color-bl">Cooperation</p>
        </Grid>
        <Grid item xs={12} md={6}>
          <Grid item xs={12} md={12}>
            <div>
              <p className="text-bold text-1H text-color-bl">Profile</p>
            </div>
            <img src="/img/main.jpg" alt="프로필 사진" id="profile-img" />
            <div>
              <p className="text-bold text-1H text-color-bl">석현승</p>
              <p>1991.12.02</p>
            </div>
            <div className="padding-top-btm-1e">
              <span className="padding-all-1e">
                <a href="https://blog.naver.com/dev_seung2" target="_blank">
                  <FontAwesomeIcon icon={faBlogger} className="icon-size" />
                </a>
              </span>
              <span className="padding-all-1e">
                <a href="https://github.com/devseung2" target="_blank">
                  <FontAwesomeIcon icon={faGithub} className="icon-size" />
                </a>
              </span>
            </div>
          </Grid>
        </Grid>
        <Grid item xs={12} md={6}>
          <Grid item xs={12} md={12}></Grid>
        </Grid>
      </Grid>
    </div>
  );
}

export default About;
